import React from "react"
import * as ReactDOMClient from 'react-dom/client';
import App from ".A"
class Header extends React.Component {
    render () {
        return(
            <header>{this.props.title}</header>
        )
    }
}



class Dom extends React.Component {
    render () {
        return (<input placeholder="Class: Dom" onClick={this.inputClick} onMouseEnter={this.onMouseEnter}></input>)
    }

    inputClick() {console.log('clicked from Dom')}
    onMouseEnter() {console.log('mouse from Dom')}

}

const app = ReactDOMClient.createRoot(document.getElementById('root'))

const second2 = ReactDOMClient.createRoot(document.getElementById('app'))

app.render(<App></App>)
